import cartFrontImage from "./images/bg-card-front.png";
import "./cart-front.css";

const CartFront = () => {
  return (
    <div className="cart-front-container">
      <img src={cartFrontImage} alt="cart" />
    </div>
  );
};

export default CartFront;
